function verifyActivities(){
	
	var activitiesDescription = $('input[name^="activityDescription"]');
	var activitiesWorkPorcent = $('input[name^="workPorcent"]');
	var workloadSelect = document.getElementById("workload_options");
	var workloadValue = workloadSelect.options[workloadSelect.selectedIndex].value;
	var totalWork = 0;

	for(i = 0; i < activitiesDescription.length; i++)
	{
		var description = activitiesDescription[i].value;
		var workPorcent = activitiesWorkPorcent[i].value;

		if(description === "")
		{
			swal('Lo sentimos', 'Una o varias actividades no poseen descripción', 'error');
			return true;
		}

		if(workPorcent < 0 || workPorcent === "")
		{
			swal('Lo sentimos', 'Uno o varios porcentajes no son válidos', 'error');
			return true;
		}

		totalWork += parseInt(workPorcent, 10);
	}
	if(workloadValue < totalWork)
	{
		swal('Lo sentimos', 'Actividades sobrepasan la carga de trabajo asignado', 'error');
		return true;
	}
	return false;
}

$('.submit-save').click(function(){

	areActivitiesIncorrect = verifyActivities();
	if(areActivitiesIncorrect)
	{
		return false;
	}

	var workloadSelect = document.getElementById("workload_options");
	var workloadExtension = $('.cbox_extension').prop('checked') ? 1 : 0;
	var activitiesDescription = $('input[name^="activityDescription"]');
	var activitiesWorkPorcent = $('input[name^="workPorcent"]');
	var idCourses = $('input[name^="idCourses"]');
	var priorities = $('input[name^="priorities"]');
	var schedules = $('input[name^="Inp-"]');

	var workloadValue = workloadSelect.options[workloadSelect.selectedIndex].value;
	var newActivitiesDescription = [];
	var newActivitiesWorkPorcent = [];
	var newIdCourses = [];
	var newPriorities = [];
	var newSchedules = [];
	var saveState = 0;

	for(i = 0; i < schedules.length; i++)
	{
		if(schedules[i].value == 1){
			/*var id = schedules[i].id.split("-")[1];
			id = parseInt(id, 10);*/

			var id = "Id"+schedules[i].id;

			var value = document.getElementById(id).value;
			newSchedules.push(value);
		}
	}

	if($(this).val() == "Enviar")
	{
		var areCoursesAssigned;
		var areSchedulesAssigned;

		areCoursesAssigned = verifyCourses(workloadValue, idCourses);
		areSchedulesAssigned = verifySchedules(newSchedules);
		if(areCoursesAssigned || areSchedulesAssigned)
		{
			return false;
		}
		saveState = 1;
	}

	for(i = 0; i < activitiesDescription.length; i++){
		newActivitiesDescription.push(activitiesDescription[i].value);
		newActivitiesWorkPorcent.push(activitiesWorkPorcent[i].value);
	}

	for(i = 0; i < idCourses.length; i++)
	{
		newIdCourses.push(idCourses[i].value);

		idCourse = idCourses[i].id.split("-")[1];
		
		priorityOption = $("input[name='option-"+idCourse+"']:checked").val();
		//prioritySelect = document.getElementById("select-"+idCourse);
		//priorityValue = prioritySelect.options[prioritySelect.selectedIndex].value;
		if(priorityOption == null)
		{
			swal('Lo sentimos', 'Uno o varios cursos no poseen prioridad', 'error');
			return false;
		}
		newPriorities.push(priorityOption);
	}

	$.ajax({
		url: '../Form_Controller/getDataFromView',
		type: "POST",
		data:{
			saveState: saveState,
			workload: workloadValue,
			extension: workloadExtension,
			activitiesDescription: JSON.stringify(newActivitiesDescription),
			activitiesWorkPorcent: JSON.stringify(newActivitiesWorkPorcent),
			idCourses: JSON.stringify(newIdCourses),
			priorities: JSON.stringify(newPriorities),
			schedules: JSON.stringify(newSchedules)
		},
		beforeSend: function(){ 
			document.getElementById("msform").style.opacity = 0.5;
			document.getElementById("loader").style.display = "block";
		},

		success: function(){
			if(saveState)
			{
				//doc.addImage(imageTec, 'JPEG', 240, 9, 45, 10);
				/*doc.fromHTML($('#customers').html(), 15, 15, {
								'width': 170,
								'elementHandlers': specialElementHandlers
							});*/
				createPDF(workloadValue, workloadExtension, 
					newActivitiesDescription, newActivitiesWorkPorcent,
					idCourses, newPriorities);
			}
			document.getElementById("loader").style.display = "none";
			document.getElementById("msform").style.opacity = 1;
			swal('Listo', 'Sus datos han sido guardados', 'success');
		},
		error: function ()
        {
        	document.getElementById("loader").style.display = "none";
			document.getElementById("msform").style.opacity = 1;
            swal('Lo sentimos', 'No se pudieron guardar los datos correctamente', 'error');
        }
	});
});

function verifyCourses(workload, courses)
{
	var minimumCourses = workload / 25;
	if(minimumCourses > courses.length)
	{
		swal('Lo sentimos', 'Cantidad de cursos es menor a la carga de trabajo', 'error');
		return true;
	}
	return false;
}

function verifySchedules(newSchedules)
{
	if(!newSchedules.length)
	{
		swal('Lo sentimos', 'No asignó horarios', 'error');
		return true;
	}
	return false;
}

function addWorkloadText()
{
	var workloadSelect = document.getElementById("workload_options");
	var workloadValue = workloadSelect.options[workloadSelect.selectedIndex].value;
	$('#div-workload').empty();
	$('#div-workload').append('<h4> Carga de trabajo seleccionada: '+workloadValue+'%</h4>');
}

function addActivitiesText()
{
	var activitiesDescription = $('input[name^="activityDescription"]');
	var activitiesWorkPorcent = $('input[name^="workPorcent"]');
	$('#div-activities').empty();
	$('#div-activities').append("<h4>Actividades seleccionadas: </h4>");
	for(i = 0; i < activitiesDescription.length; i++)
	{
		$('#div-activities').append('<div> - '+activitiesDescription[i].value+' con un ' +activitiesWorkPorcent[i].value+ '%</div>');
	}
}

function addCoursesText()
{
	var idCourses = $('input[name^="idCourses"]');
	//var priorities = $('input[name^="priorities"]');
	$('#div-courses').empty();
	$('#div-courses').append("<h4>Cursos seleccionados:</h4>");
	for(i = 0; i < idCourses.length; i++)
	{
		var idCourse = idCourses[i].id.split("-")[1];
		var code = $("#div-code-"+idCourse).text();
		var name = $("#div-name-"+idCourse).text();
		priorityOption = $("input[name='option-"+idCourse+"']:checked").val();

		$('#div-courses').append('<div> - '+code+'\t'+name+' con prioridad '+priorityOption+'</div>');
		//$("#element td:nth-child(2)").text('ChangedText');

	}
}

function addSchedulesText()
{
	var schedules = $('input[name^="Inp-"]');
	$('#div-schedules').empty();
	$('#div-schedules').append("<h4>Horarios seleccionados:</h4>");
	
	for(i = 0; i < schedules.length; i++)
	{
		if(schedules[i].value == 1){

			var id = schedules[i].id.split("-")[1];

			/* Get the hour of schedule*/
			var hour = document.getElementById('Description-Inp-'+id).value;
			
			/* Get the day of schedule*/
			id = parseInt(id, 10);
			var remainder = (id-1) % totalDays;
			var day = days[remainder];

			$('#div-schedules').append("<div> - "+day+ ": "+ hour + "</div>");
		}
	}
}


/* PDF section */

function createPDF(workload, extension, activitiesDescription, activitiesWorkPorcent, idCourses, priorities)
{
	var titleText = 'INFORMACION PARA ASIGNACIÓN DE CURSOS Y HORARIOS ING. EN COMPUTACIÓN-SAN JOSÉ ('+$("#namePeriod").text()+')'; 
	doc.addImage(imageTec, 'JPEG', 240, 5, 50, 12);
	doc.setFontSize(10);
	doc.text(titleText, 10, 30);
	
	/* Table professor */
	doc.autoTable(getColumns(1), getDataProfessor(), {
		theme: 'grid',
		startY: 45,
		margin: {right: 195},
		headerStyles: {
			fillColor: '#0d39a0'
		}
	});

	/* Table workload */
	doc.text("Carga", 15, 70);
	doc.autoTable(getColumns(2), getDataWorkload(workload, extension), {
		theme: 'grid',
		startY: 72,
		margin: {right: 195},
		headerStyles: {
			fillColor: '#0d39a0'
		}
	});

	/* Table activities */
	doc.text("Actividades", 15, 97);
	doc.autoTable(getColumns(3), getDataActivities(activitiesDescription, activitiesWorkPorcent), {
		theme: 'grid',
		startY: 99,
		margin: {right: 195},
		headerStyles: {
			fillColor: '#0d39a0'
		}
	});

	/* Table courses */
	doc.text("Cursos", 106, 43);
	doc.autoTable(getColumns(4), getDataCourses(idCourses, priorities), {
		theme: 'grid',
		startY: 45,
		margin: {
			left: 105,
			right: 105
		},
		headerStyles: {
			fillColor: '#0d39a0'
		},
		styles:{
			overflow: 'linebreak',
			columnWidth: 'wrap'
		},
		columnStyles: {
			name: {columnWidth: 53},
			text: {columnWidth: 'auto'}
		}
	});

	/* Table schedules */
	doc.text("Horarios", 195, 43);
	doc.autoTable(getColumns(5), getDataSchedules(), {
		theme: 'grid',
		startY: 45,
		margin: {left: 195},
		headerStyles: {
			fillColor: '#0d39a0'
		}
	});
	doc.save('formulario.pdf');
}



var getColumns = function (typeTable) {
    
	if(typeTable === 1)
	{
		return [
			{title: "Profesor(a)", dataKey: "professor"}
		];
	}

	if(typeTable === 2)
	{
		return [
			{title: "Jornada laboral", dataKey: "workload"},
			{title: "Ampliación", dataKey: "extension"}
		]
	}

	if(typeTable === 3)
	{
		return [
			{title: "Descripción", dataKey: "description"},
			{title: "%", dataKey: "porcent"}
		];
	}

	if(typeTable === 4)
	{
		return [
			{title: "Prioridad", dataKey: "priority"},
			{title: "Código", dataKey: "code"},
			{title: "Nombre del curso", dataKey: "name"}
		];
	}

	if(typeTable === 5)
	{
		return [
			{title: "Día", dataKey: "day"},
			{title: "Hora", dataKey: "hour"}
		];
	}
};

function getDataProfessor()
{
	var data = [];
	data.push({
		professor: $("#nameProfessor").text()
	});

	return data;
}

function getDataWorkload(workload, extension)
{
	var extensionText = extension ? 'SI': 'NO';
	var data = [];
	data.push({
		workload: workload+"%",
		extension: extensionText
	});

	return data;
}

function getDataActivities(activitiesDescription, activitiesWorkPorcent)
{
	var data = [];

	for (var i = 0; i < activitiesDescription.length; i++) {
		data.push({
			description: activitiesDescription[i],
			porcent: activitiesWorkPorcent[i]
		});
	}

	return data;
}

function getDataCourses(idCourses, priorities)
{
	var data = [];
	for (var i = 0; i < idCourses.length; i++) {

		var idCourse = idCourses[i].id.split("-")[1];
		data.push({
			priority: priorities[i],
			code: $("#div-code-"+idCourse).text(),
			name: $("#div-name-"+idCourse).text()
		});
	}

	return data;
}

function getDataSchedules(schedules)
{
	var data = [];
	var schedules = $('input[name^="Inp-"]');
	$('#div-schedules').empty();
	$('#div-schedules').append("<h4>Horarios seleccionados:</h4>");
	
	for(i = 0; i < schedules.length; i++)
	{
		if(schedules[i].value == 1){

			var id = schedules[i].id.split("-")[1];
			/* Get the hour of schedule*/
			var hour = document.getElementById('Description-Inp-'+id).value;
			
			/* Get the day of schedule*/
			id = parseInt(id, 10);
			var remainder = (id-1) % totalDays;
			var day = days[remainder];

			data.push({
				hour: hour,
				day: day
			});
		}
	}
	
	

	return data;
}